import 'package:pick_up_recipe/src/themes/light_theme.dart';

void main() {
  runApp(
    const ProviderScope(
      child: MyApp(),
    ),
  );
}

class MyApp extends ConsumerStatefulWidget {
  const MyApp({super.key});

  @override
  ConsumerState<MyApp> createState() => _MyAppState();
}

class _MyAppState extends ConsumerState<MyApp> {
  final getIt = GetIt.instance;

  void setupGetIt() {
    getIt.registerSingleton<LatestRecipesDAO>(MockedLatestRecipesDAOInstance());
    getIt.registerSingleton<ActivePacksDAO>(MockedActivePacksDAOInstance());
  }

  @override
  void initState() {
    super.initState();
    setupGetIt();
  }

  @override
  Widget build(BuildContext context) {
    return MaterialApp.router(
      routerConfig: AppRouter(ref).config(),
      theme: lightTheme,
      darkTheme: darkTheme,
    );
  }
}

@RoutePage()
class RootScreen extends StatefulWidget {
  const RootScreen({super.key});

  @override
  State<RootScreen> createState() => _RootScreenState();
}

class _RootScreenState extends State<RootScreen> {
  final getIt = GetIt.instance;

  void setupGetIt() {
    getIt.registerSingleton<LatestRecipesDAO>(MockedLatestRecipesDAOInstance());
    getIt.registerSingleton<ActivePacksDAO>(MockedActivePacksDAOInstance());
  }

  @override
  Widget build(BuildContext context) {
    return AutoTabsScaffold(
      routes: [
        const MainRoute(),
        BrewRoute(recipe: RecipeData.fromJson(json.decode(mockedJson))),
        // ProfileRoute(),
      ],
      bottomNavigationBuilder: (_, tabsRouter) {
        return BottomNavigationBar(
          currentIndex: tabsRouter.activeIndex,
          onTap: tabsRouter.setActiveIndex,
          items: const [
            BottomNavigationBarItem(
              label: 'Main',
              icon: Icon(Icons.coffee),
            ),
            BottomNavigationBarItem(
              label: 'Add pack',
              icon: Icon(Icons.add),
            ),
            BottomNavigationBarItem(
              label: 'Settings',
              icon: Icon(Icons.settings),
            ),
          ],
        );
      },
    );
  }
}

